INSERT INTO `assets` VALUES (3,'Meetion Slim 2.4G Wireless Chocolate Computer Keyboard','141','Keyboards','Unbranded',NULL,'FEATURES\nMeetion Slim 2.4G Wireless Chocolate Computer Keyboard\nUltrathin chocolate computer keycaps, UV letter indelible\nUSB Nano receiver automatic connection. No need to match\nCompatible with Windows 2000 / XP / 7 / 8 /10 / Vista\nCover range up to 10m\nSlim Wireless Keyboard\n2.4G Wireless Keyboard\nPRODUCT SPECIFICATIONS\nBrand\nMeetion\nItem model number\nWK841\nProduct Type\nKeyboard\nColour\nWhite','https://vault.valueventures.co.za/assets/asset_images/05bb8f56-550d-41a8-a77a-52111659fc32photo.jpg','loan','2021-09-29 08:54:10','2021-10-06 15:34:28',2,1),(4,'Logitech M720 Triathlon Bluetooth Mouse','680','Mouse','Unbranded',NULL,'Logitech M720 Triathlon Bluetooth MouseBuilt for endurance, versatility, and comfort- Succeed in a multi-device world with M720 Triathlon Mouse.- You\'ll power through tasks by switching seamlessly between 3 computers, and fly through documents and web pages with hyper-fast scrolling.- Boosted efficiency means this Bluetooth and Unifying mouse lasts for 24 months on a single AA battery.- All that in a full-size shape fitting comfortably under your hand.Easy-Switch technology- Pair your mouse with 3 computers, then switch seamlessly between them at a touch of the button conveniently positioned under your thumb.- The 3 illuminated numbers always let you know to which device you\'re connected.Hyper-fast scrolling- Fly through long documents and web pages with a spin of the wheel - and stop instantly - or switch to click-to-click scrolling when you need precision.Durable, sculpted design- A true athlete, M720 is designed to endure, with buttons built to withstand up to 10 million clicks.- The large-sized, right-hand design fits comfortably in your palm, the rubber surface making it extra soft to the touch.24-month battery life- You\'ll like this mouse\'s boosted efficiency, with 24 months of power on a single AA battery.- It may vary based on use and computing conditions.Personalized productivity- Unlock the full range of possibilities and customize to fit your needs on Mac OS X and Windows by downloading Logitech Options Software.- Set up and assign tasks to buttons with step-by-step instructions.- An Immersion Guide is available to help answer your questions. Dimensions- Mouse (height x width x depth): 115 mm x 74 mm x 45 mm- Weight: 135g- Nano receiver (height x width x depth): 14.4 mm x 18.7 mm x 6.1 mm- Weight: 18gSystem Requirements- Bluetooth Smart- Windows 10 or later, Windows 8- Mac OS X 10.10 or late- Chrome OS- Android 5.0 or later- Unifying Receiver- Windows 10 or later- Windows 8- Windows RT- Windows 7- Mac OS X 10.05 or later- Chrome OS- Internet connection for software download, USB port.Technical SpecificationsConnection Type:- Bluetooth Smart- 2.4GHz wireless connection- Wireless range: 10 m- It may vary based on use and computing conditions.- Indicator Lights LED: Battery LED- Connect / Power: Yes, on/off switch- Battery Details: 1 x AA- Battery life: 24 months- Battery life may vary based on user and computing conditions.- DPI (Min/Max): 1000 +/- - Sensor technology: Logitech Advanced Optical Tracking- Sensor resolution: 1000 dpi- Scroll Wheel: 3G Core- Number of buttons: 8- Standard and Special Buttons: Tilt wheel with middle click- Gesture Support (Windows): Yes- Gesture Support (Mac): Yes\nWhat\'s in the box1 x Mouse','https://vault.valueventures.co.za/assets/asset_images/484f5552-7dd2-48a9-8e47-e624cb418b37photo.jpg','safe and insured','2021-09-30 11:23:18','2021-09-30 11:25:35',4,3),(5,'Volkano Impulse Series Bluetooth Headphones - White','256','Headphones','Volkano',NULL,'<strong>Volkano Impulse Series Bluetooth Headphones - White</strong><br /><br />- Bluetooth Wireless Headphones<br />- Walk and Talk<br />- Micro SD Card Reader<br />- Line-in Mode<br />- FM Radio<br /><br /><strong>Specifications:</strong><br />- Input Voltage: 3.7 5V<br />- Bluetooth Version: V4.0<br />- Transmission Distance: 10M(approx. 33 ft)<br />- Battery Capacity: 250mAh<br />- Transmission Frequency: 2.45GHz<br />- Charging Time: 70min<br />- Supporting Operating System: IOS, Android<br />- Minimum Rated Talk Time: 8 hours<br />- Support: FM/TF Card<br />- Minimum Rated Standby Time: 250 hours<br />- Battery Type: Lithium Ion<br />- Package Dimensions: 192 x 188 x 82mm (L x W x T)','https://vault.valueventures.co.za/assets/asset_attachments/b881461c-50e8-43c3-bb9c-13c24c0759bdphoto.jpg','safe','2021-09-30 11:23:26','2021-10-19 10:35:37',4,3),(6,'Mi mobile mI 2 xs','129','Other','undefined',NULL,'undefined','https://vault.valueventures.co.za/assets/asset_images/26a8d389-589c-45e3-a41b-256ba94a1bfaphoto.jpg','safe','2021-09-30 11:24:34','2021-09-30 11:24:34',4,3),(7,'Lenovo Intel Core I5 Laptop','7999','Motherboards','Lenovo',NULL,'Lenovo Intel Core I5 Laptop','https://vault.valueventures.co.za/assets/asset_images/0713863d-453c-4a04-ae52-bab68b863af7photo.jpg','safe','2021-09-30 11:28:54','2021-09-30 11:30:53',4,3),(8,'16 Bottle Wine Cooler','2929','Wine Cellars','Unbranded',NULL,'16 Bottle Wine Cooler','https://vault.valueventures.co.za/assets/asset_images/f399dbce-d8e3-46f6-be57-774910f622d3photo.jpg','safe','2021-09-30 11:39:37','2021-09-30 11:40:35',4,3),(16,'Lenovo Intel Core I5 Laptop','7999','Motherboards','Lenovo',NULL,'Lenovo Intel Core I5 Laptop','https://vault.valueventures.co.za/assets/asset_images/01aa6e57-01ab-445b-92d2-8c33d3a9af42photo.jpg','loan','2021-09-30 12:18:47','2021-10-06 14:12:54',2,1),(27,'Lenovo Intel Core I5 Laptop','7999','Motherboards','Lenovo',NULL,'Lenovo Intel Core I5 Laptop','https://vault.valueventures.co.za/assets/asset_images/08de981b-f471-40f6-b2f8-c3053da85c2dphoto.jpg','safe','2021-09-30 12:57:13','2021-09-30 12:57:37',4,3),(35,'vivo 1804','5000','mobile','vivo','345435736ad084ad879690213232',NULL,'https://vault.valueventures.co.za/assets/serverDefault/mobile.png','loan','2021-10-02 08:14:56','