: 7kg\nNet Weight: 61kg\nRated Power: 1950W\nSpin Speed (r / min) : 1200\nEnergy class: A ++\nPower Supply: 220-240V~,50Hz\nMAX. Current: 10A\nStandard Water Pressure: 0.05MPa~1MPa\nDimensions: (WxDxH) 595 x 495 x 850mm\nModel: MFE70-S1202/A07-EU-S','https://vault.valueventures.co.za/assets/asset_images/592f7aca-57fb-4ff0-84d7-f307868b0e90photo.jpg','safe','2021-10-07 14:24:22','2021-10-07 14:24:22',16,28),(107,'Galaxy Note9','5000','mobile','samsung','3454350281ed81168d3aab21323',NULL,'https://vault.valueventures.co.za/assets/serverDefault/mobile.png','safe and insured','2021-10-07 14:33:39','2021-10-07 14:33:39',16,28),(108,'Huawei Watch Fit','1499','Printer Consumables','Unbranded',NULL,'10 DAYS BATTERY LIFE\nMore Possibilities on your Wrist\nFeaturing a gorgeous 1.64\" rectangle AMOLED display and 280 x 456 HD resolution,HUAWEI WATCH FIT delivers an ultra-clear and wide viewing experience. Auto-brightness adjustment offers better viewing in sunlight while the six Always-Onwatch faces allow you to express your personal style and mood on any given day.\n1.64inch display\n2.5Dcurvedglass\n70%screen-to-body ratio\n280 x 456HD resolution\n326PPI\n16.7mega colours\nRefresh Your Everyday Style\nPersonalize the theme to match your everyday look with various colourful watch faces. In addition to the official ones, there are abundant stunning watch faces in the Watch Face Store for you to choose from. And also you can customize your own one with any photo from your mobile device.\nCustomized for YourConvenience\nNow the functions that matter on the watch face can be customized easily. What you care about most like weather, heart rate, steps, battery life and others are free to be selected and set on a suitable position according to your viewing habits.\nAny Style You Want\nThe textured matte watch frame pairs perfectly with the colourful and soft straps for a premium and solid design. HUAWEI WATCH FIT brings you a sophisticated and trendy look all the time.\nLighter Design,Longer Battery Life\nThe incredibly thin and light HUAWEI WATCH FIT packs upgraded battery performance into just 21 grams,7making it a perfect all-day companion. Featuring the dual chipset architecture and power-saving algorithms, this watch can last for 10 days. And with the quick charge technology, the watch can support you a whole day with a 5-minute charge.\nPrivate Trainer on Your Watch\nStart training anytime with HUAWEI WATCH FIT and be free from searching for workout demonstration videos. This watch provides 12 kinds of animated quick-workoutslike Exercise at Work, Full-Body Stretch, Ab ripper and includes 44 standard movement demonstrations. Make the best of your down time like coffee breaks or lazy hours on the weekend to keep fit with thissmart watch.\n96 Workout Modes\nHUAWEI WATCH FIT provides precise and real-time workout metrics for 11 professional sport modes including running, swimming and cycling. The 85 custom workout modes allow you to unleash your potential, whether you\'re into yoga or high-intensity interval training, the watch also keeps track of your real-time heart rate, calories and duration of the workout.\nFind YourBest Rhythm\nWith a built-in GPS sensor, 5 ATM, AI heart rate algorithm and innovative sensors, HUAWEI WATCH FIT is made for all the ways you exercise. This watch helps you train better by providing real-time metrics, scientific training effect evaluations and professional guidance.\nSmart Workout Partner,Advanced Metrics\nHUAWEI WATCH FIT is able to detect the start of a workout, recognize the workout type and remind you to track it.11Whether you are running or swimming, HUAWEI WATCH FIT can track the exact workout metrics you need. After you finish, you can see more detailed metrics, professional analysis and scientific guidance in HUAWEI Health App.\nStay MotivatedEvery Day\nHUAWEI WATCH FIT tracks your fitness progress all day and reminds you to stand up every once in a while to prevent you from long-time sitting. The watch records your daily steps, active hours, and periods of medium to high-intensity activities in three colourful circles, and provides you a sense of accomplishment when completing them.\n24-Hour Heart RateMonitoring\nThanks to the HUAWEI TruSeen 4.0 heart rate monitoring technology, this smart watch can accurately monitor your heart rate in real-time during the day even or when you are sleeping. And timely detect if your heart rate exceeds the normal range, and send out a reminder to provide you with all-day health protection.\nOxygen SaturationDetection13\nVery low levels of blood oxygen saturation (SpO2) can result in health problems. Try to wear HUAWEI WATCH FIT and start detecting SpO2with a simple touch. Only a few seconds, it will show the detecting data accurately and give you a reference to pay attention to','https://vault.valueventures.co.za/assets/asset_images/774c0fd6-34b6-451f-8184-3e341cc1ce32photo.jpg','safe','2021-10-07 14:35:55','2021-10-07 14:35:55',16,28),(109,'Logitech Mx Master 3 Advanced Wireless Mouse in Graphite','1450','Mouse','Logitech',NULL,'<ul>\r\n<li>Ultrafast magspeed scrolling - remarkable speed, precision &amp; quietness of electromagnetic scrolling with all new magspeed wheel - up to 90% faster, 87% more precise &amp; Ultra quiet</li>\r\n<li>Comfort shape and intuitive controls - work comfortably with perfectly sculpted shape and ideally placed thumb wheel and controls</li>\r\n<li>App-specific customizations - Speed up your workflow with predefined app-specific profiles and numerous customization options</li>\r\n<li>Flow CROSS-COMPUTER control - work seamlessly on three computers. Seamlessly transfer cursor, text, and files - between windows &amp; macOS, desktop &amp; laptop</li>\r\n<li>Works on any surface even on glass with darkfield 4000 DPI sensor. It is faster and 5x more precise than the basic mouse - so you always hit the right Pixel</li>\r\n<li>Usb-c Rechargeable - Full charge lasts up to 70 days, quick 1 min charge gives 3