r functionality<br>\nXiaomi Mi TV Stick has 1GB of RAM and 8GB of built-in storage. Xiaomi Mi TV stick comes with 1080p support.<br>','https://vault.valueventures.co.za/assets/asset_images/db480654-4786-4aff-984a-402f596b2e8bphoto.jpg','safe','2021-10-20 13:57:01','2021-10-20 13:57:01',21,37),(154,'Memre Premium Classic Pillow','479','Network Accessories','Unbranded',NULL,'FEATURES\nThe Memr* Classic Wrapped Pillow is perfect for people who sleep on their back, side or stomach.\nLUXURIOUS SUPPORT\nWith premium quality, 45D Memory Foam that provides firmer support & perfectly cushions & moulds to the natural contours of your head & neck while you sleep!\nRELIEVES PAIN & IMPROVES CIRCULATION\nThis pillow provides superior anatomical support, relieving tension in the muscles & nerves giving them the time to rest & heal.\nPRODUCT SPECIFICATIONS\nBrand\nMemre\nItem model number\nMEM433\nProduct Type\nPillow\nColour\nWhite','https://vault.valueventures.co.za/assets/asset_images/0650699f-5ef9-4573-a747-f0fb68f0843bphoto.jpg','safe and insured','2021-10-20 16:11:22','2021-10-20 16:12:09',29,75),(157,'Centurion D5 Evo Gate Motor - Motor Only','4475','Electrical Equipment','Centurion',NULL,'Motor Only<br />You can enjoy all the amazing features and functionality of our flagship sliding gate operator ? intuitive setup, visual diagnostics, advanced timer functionality ? even if you don?t have mains power at your gate!<br /><br />Features:<br /><br />You can enjoy all the amazing features and functionality of our flagship sliding gate operator ? intuitive setup, visual diagnostics, advanced timer functionality ? even if you don?t have mains power at your gate! Simply connect a transformer to this incredibly cost-effective model?s included rectifier, and enjoy the freedom of fully DIY gate automation! No expensive high-voltage cable runs, no costly isolators, no sweat!<br /><br />You\'ll save on installation costs<br />We want to bring quality, reliable gate automation to the world ? mains or no mains! The D5-Evo Low-Voltage requires only a 15-19V AC input, so you?ll save a bundle on cabling costs! Plus, because it?s a low-voltage installation, there?s no need to fit costly and unsightly isolators.<br /><br />A breeze to commission&nbsp;<br />Whether you?re a sparky, an engineer or just a homeowner wanting to get the ultimate in security and convenience, the D5-Evo Low-Voltage makes commissioning easy. Just connect your step-down transformer to the rectifier included with the kit and watch the feature-rich and intuitive controller spring to life.<br /><br />Battery backup<br />We pioneered power failure protection in gate motors. So in line with all our other operators, the D5-Evo sliding gate motor carries on guarding your entrance even when the lights go out.<br /><br />All important speed<br />The original D5 made a mark for itself being a quick operator opening the gate swiftly when you arrive at your entrance. The D5-Evo is now that little bit faster, opening your average four metre gate in less than 12 seconds, adding even more security and convenience.<br /><br />Open it the way you like it<br />Rapid opening but a more tempered closing just in case a loved one is in the way, that\'s the sort of sophistication in motor control you can expect from the D5-Evo. Added to this, you can vary the acceleration and deceleration of your gate and make it move so smoothly, it will do so for many years to come.<br /><br />Pushes like a mule<br />Such a compact package but such a potent push force, it will reliably move almost any gate weighing up to 500kg for a very long time.<br /><br />Wide awake all the time!<br />Incorporating the tried and tested DOSS position control system of its predecessors, the D3 and D5, theCENTURION D5-Evo moves accurately open and closed, stopping in just the right spot each and every time. It\'s also wide awake to any obstruction that might cross its path, ensuring safe and sensitive anti-crushing protection.<br /><br />It will turn heads<br />The D5-Evo takes on a new and more attractive look compared to the original D5. It\'s nice to know that even your trusty gate guard will turn heads.<br /><br />Plug and play<br />The LCD-based controller makes child\'s play of setting up the gate. It is literally plug and play - the D5-Evo\'s controller does all the thinking for you.<br /><br />It\'s got it all<br />What a pleasure to click through an almost endless list of really useful features - from multiple Modes of Operation, Gate operating parameters, Pillar Light control with pre-flash, Alarm functions, Positive Close Mode and Real Time Clock and Calendar to enable time-based features - to helpful diagnostic feedback. It just stops short of making the coffee!<br /><br />Forever yours<br />We know that this compact companion will serve you well - year, after year, after year. So just like all other CENTURION products, your beautiful D5-Evo gate motor also comes with an industry-leading 24 month warranty for added peace of mind.<br /><br />Alarm features (a world first)1<br />Burglars have some nifty techniques to get into your home. Fortunately, criminals can\'t outsmart the CENTURION D5-Evo. An Ambush Alarm will alert your security company if the opening or closing beams are interrupted for a pred','https://vault.valueventures.co.za/assets/asset_images/b4ea4770-3881-4d26-8ad5-536b783a5667photo.jpg','safe','2021-10-21 09:48:00','2021-10-21 09:48:00',21,37),(158,'Soccer Waterbottle 700ML - Blue','58','Soccer Boots','Unbranded',NULL,'Soccer Waterbottle 700ml - Blue','https://vault.valueventures.co.za/assets/asset_images/690fde83-e4b6-4538-9164-344d1e7f0a08photo.jpg','safe','2021-10-21 09:48:26','2021-10-21 09:48:26',21,37),(159,'Sony WH-1000XM4 Wireless Noise-canceling Headphones','5071','Studio & Recording Equipment','Sony',NULL,'Sony WH-1000XM4 Wireless Noise-Canceling Headphones','https://vault.valueventures.co.za/assets/asset_images/6f24b1e7-861a-423d-9575-75590fe564c8photo.jpg'