ns, and adjust cursor speed via Logitech Options software.\nCURSOR SPEED SWITCH\nChange the speed and accuracy of your cursor for optimal control with a press of a button.\nMX Vertical features a best-in-class 4000 DPI high-precision sensor, resulting in 4x less hand movement.\nPREMIUM SCROLL WHEEL\nGet things done quicker with a precision scroll wheel featuring a convenient middle click.\nFAST RECHARGING\nStay powered for up to four months on a full charge  and get three hours of use from a one-minute quick charge. Use the USB-C charging cable to top up the power.\nTHREE WAYS TO CONNECT\nConnect MX Vertical via the included USB-C charging cable, Logitech Unifying Receiver, orBluetooth.\nFor the best product experience withBluetooth, please upgrade your computers operating system to the latest version.\nDIMENSIONS\nMX Vertical\nHeight: 78.5 mm\nWidth: 79 mm\nDepth: 120 mm\nWeight: 135 g\nTECHNICAL SPECIFICATIONS\nSensor\nNominal value: 1000 & 1600 dpi\nDPI (Minimal and maximal value): 400-4000 dpi (can be set in increments of 50 dpi)\nButtons\n4 Customizable buttons (By default: Back/Forward, DPI, Middle click)\nScroll wheel\nPrecision wheel\nBattery life\nRechargeable Li-Po battery (240 mAh)\nWireless operating distance\n10 m wireless','https://vault.valueventures.co.za/assets/asset_images/9eeca35e-2198-4a2a-82e7-356e4a535ff0photo.jpg','safe','2021-10-22 07:03:00','2021-10-22 07:03:00',21,37),(180,'iPhone XS','5000','mobile','Apple','345435811865E9-B090-4C8A-AD55-5A4D7F4AC7C92132377',NULL,'https://vault.valueventures.co.za/assets/serverDefault/mobile.png','safe and insured','2021-10-22 07:03:38','2021-10-22 07:03:38',21,37),(182,'Pre-Owned Apple iPhone 6s 64GB Rose Gold','3300','Certified Pre-Owned Cellphones','Apple',NULL,'iPhone 6s boasts multi-touch, with 3D Touch, 12MP pictures and Live Photos, an A9 chip, 7000 series aluminium, 4.7-inch Retina HD display and 12-megapixel iSight camera. In short, iPhone 6s boasts innovation on every level and the bottom line is