 in for an instant charge of about 50%, and also back up power with the charge that remains. Charging current: 380mA maximum (varies with usage conditions) Adds up to 240mAh to devices battery per AA battery Enables immediate usage of the device, even if the battery is fully depleted 1umA discharge current from alkaline battery when charging is deactivated Typical efficiency: 87% Compact size Automatic start-up when current drawn at output (upon connection to device) Automatic shutdown when no current drawn at output (10 second delay) Automatic shutdown when primary battery is depleted\r\n<p><strong>Features</strong><br />Highly portable, instant MP4 Player and mobile phone emergency charger. A powerful charging with a single AA battery gives you a few hours of playtime with your MP4 player and about 2 hrs of talk time on your mobile phone.The charge time is the same as for your mains-pluggable charger and may vary depending on your handset or player. Comes with four different plugs matching different Players and phones:</p>\r\n<strong>To charge your player or Mobile Phone</strong><br />\r\n<ul>\r\n<li>Load a single AA battery into the charger.</li>\r\n<li>Connect your player to the charger using the compatible plug.</li>\r\n<li>Connect the charger\'s plug with your MP4 player or mobile phone.</li>\r\n<li>Your MP4 player will not display that it is charging but the LED indicator on the charger will be on.</li>\r\n<li>Your phone should be showing now the charging status.</li>\r\n</ul>','https://vault.valueventures.co.za/assets/asset_images/34249f0e-14de-4492-bf4c-8530a50a2937photo.jpg','safe','2021-10-28 06:50:53','2021-10-28 06:50:53',30,129),(248,'Esquire Mobile Phone Charger in Blue','79','Batteries & Chargers','Esquire',NULL,'Esquire Mobile Phone Charger- Blue - Connectors for Nokia, Sony, Samsung, Motorola Retail Box 7 Days warranty Running out of power for your mobile puts a serious dent in your communication possibilities, and is in short a total nightmare, Wi