 of power for your mobile puts a serious dent in your communication possibilities, and is in short a total nightmare, With Mobile charger, such experiences are a thing of the past. Just insert one Pen light battery into the unit and plug it in for an instant charge of about 50%, and also back up power with the charge that remains. Charging current: 380mA maximum (varies with usage conditions) Adds up to 240mAh to devices battery per AA battery Enables immediate usage of the device, even if the battery is fully depleted 1umA discharge current from alkaline battery when charging is deactivated Typical efficiency: 87% Compact size Automatic start-up when current drawn at output (upon connection to device) Automatic shutdown when no current drawn at output (10 second delay) Automatic shutdown when primary battery is depleted\r\n<p><strong>Features</strong><br />Highly portable, instant MP4 Player and mobile phone emergency charger. A powerful charging with a single AA battery gives you a few hours of playtime with your MP4 player and about 2 hrs of talk time on your mobile phone.The charge time is the same as for your mains-pluggable charger and may vary depending on your handset or player. Comes with four different plugs matching different Players and phones:</p>\r\n<strong>To charge your player or Mobile Phone</strong><br />\r\n<ul>\r\n<li>Load a single AA battery into the charger.</li>\r\n<li>Connect your player to the charger using the compatible plug.</li>\r\n<li>Connect the charger\'s plug with your MP4 player or mobile phone.</li>\r\n<li>Your MP4 player will not display that it is charging but the LED indicator on the charger will be on.</li>\r\n<li>Your phone should be showing now the charging status.</li>\r\n</ul>','https://vault.valueventures.co.za/assets/asset_images/59163896-3198-458e-b9e9-fd1aedc463a6photo.jpg','safe','2021-10-28 06:51:12','2021-10-28 06:51:12',30,129),(251,'The Mocvd Challenge: A Survey Of Gainasp-inp And Gainasp-gaas For Photonic And Electronic Device Applications Second Edition','1739','Books','Unbranded',NULL,'<P>Written by one of the driving forces in the field, <STRONG>The MOCVD Challenge</STRONG> is a comprehensive review covering GaInAsPInP, GaInAsPGaAs, and related material for electronic and photonic device applications. These III-V semiconductor compounds have been used to realize the electronic, optoelectronic, and quantum devices that have revolutionized telecommunications. The figure on the back cover gives the energy gap and lattice parameter for the entire compositional range of the binary, ternary, and quaternary combinations of these III-V elements. By understanding the material and learning to control the growth new devices become possible: the front cover shows the worlds first InP/GaInAs superlattice that was fabricated by the author ? this has gone on to be the basis of modern quantum devices like quantum cascade lasers and quantum dot infrared photodetectors.</P> <P></P> <P>Now in its second edition, this updated and combined volume contains the secrets of MOCVD growth, material optimization, and modern device technology. It begins with an introduction to semiconductor compounds and the MOCVD growth process. It then discusses<EM> in situ</EM> and <EM>ex situ</EM> characterization for MOCVD growth. Next, the book examines in detail the specifics of the growth of GaInP(As)-GaAs and GaInAs(P)-InP material systems. It examines MOCVD growth of various III-V heterojunctions and superlattices and discusses electronic and optoelectronic devices realized with this material. Spanning 30 years of research, the book is the definitive resource on MOCVD. </P>','https://vault.valueventures.co.za/assets/asset_images/cd0bf758-45c0-49c7-b22e-ac8304ee29d2photo.jpg','safe and insured','2021-10-28 06:51:20','2021-10-28 06:52:48',30,129),(260,'Apple Macbook Pro A1278 Laptop','7475','MacBooks','Unbranded',NULL,'[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"4.9.0\" _module_preset=\"