d look like regular underwear</li>\n<li>Odours are neutralised and liquids are held quickly by the absorbent core  ensuring a dry feeling.</li>\n<li>High quality materials and cuffs assure maximum protection against leaks</li>\n<li>The seams tear open at the side for convenient, easy removal</li>\n</ul>\nSpecification\nSize\nWaist\nPieces per pack\nSmall:\n60 cm -90 cm\n14 pieces\nMedium:\n80 cm - 120 cm\n14 pieces\nLarge:\n100 cm - 150 cm\n14 pieces\nX-Large:\n130 cm - 170 cm\n14 pieces','https://vault.valueventures.co.za/assets/asset_images/9cd40d41-3918-456c-9cd1-a782ca0542d8photo.jpg','safe','2021-10-28 07:56:21','2021-10-28 07:56:21',30,129),(278,'Xiaomi Mi Tv Box S Media Player','1169','TV Boxes & Media Streamers','XiaoMi',NULL,'Connect to a world of content and entertainment at home with Mi Box S.<br /><br />Running on the latest Android TV 8 it is easy to use, supports voice controls and your favorite apps such as Netflix, DSTV Now, VUDU, YouTube, SlingTV and more!<br /><br />Experience stunning 4K HDR visuals and DOLBY DTS for an immersive experience.<br />Catch your favorite TV shows, play games, watch the news or listen to the radio.<br /><br />Media Supported<br />\r\n<ul>\r\n<li>Decoder Format: H.263,H.264,H.265,HD MPEG4</li>\r\n<li>Video format: 3GP,4K,DIVX,H.264,H.265,M4V,MKV,MP4,MPEG2,MPEG4,RM,RMVB,VC-1,VOB,WMV</li>\r\n<li>Audio format: AAC,AMR-NB,AMR-WB,APE,FLAC,OGG,WAV,WMA</li>\r\n<li>Photo Format: BMP,GIF,JPEG,TIFF</li>\r\n<li>Support 5.1 Surround Sound Output: Yes</li>\r\n</ul>\r\nProduct Details<br />\r\n<ul>\r\n<li>Language: Multi-language</li>\r\n<li>HDMI Version: 2.0</li>\r\n<li>Other Functions: 3D Games,3D Video, DLNA, ISO Files, Miracast, NTSC, PAL</li>\r\n<li>External Subtitle Supported: No</li>\r\n<li>HDMI Function: HDCP</li>\r\n<li>Power Consumption.: 2W</li>\r\n<li>RJ45 Port Speed: 1000Mbps</li>\r\n</ul>','https://vault.valueventures.co.za/assets/asset_images/cb9a719f-32a4-46e9-b8bf-fee9c1d74611photo.jpg','safe','2021-10-28 09:20:53','2