Unbranded',NULL,'Furniture Shifters','https://vault.valueventures.co.za/assets/asset_images/7069b184-fa8b-4384-8e18-18effc6c43a0photo.jpg','safe and insured','2022-01-03 11:40:42','2022-01-03 11:44:10',41,153),(334,'Petrol Clothing Co Petrol Clothing Vespa Hoodie','750','Tops','Unbranded',NULL,'Brand: Petrol Clothing Co<br/>Description: \"Poegie\"/Vespa Hoodie <br />\n<br />\nFabric Composition: <br />\n270g Cotton/Polyester - 70/30<br />\nEnzyme Washed - premium finish, brushed<br />\nWash Care Instructions:<br />\nCold -30 Degrees Wash<br />\nDo Not Wring<br />\nDo Not Bleach<br />\nCool Iron On Reverse','https://vault.valueventures.co.za/assets/asset_images/55356eb8-8616-4b68-8988-6fc031f829aaphoto.jpg','safe','2022-01-03 11:40:50','2022-01-03 11:40:50',41,153),(335,'The Mocvd Challenge: A Survey Of Gainasp-inp And Gainasp-gaas For Photonic And Electronic Device Applications Second Edition','1771','Books','Unbranded',NULL,'<P>Written by one of the driving forces in the field, <STRONG>The MOCVD Challenge</STRONG> is a comprehensive review covering GaInAsPInP, GaInAsPGaAs, and related material for electronic and photonic device applications. These III-V semiconductor compounds have been used to realize the electronic, optoelectronic, and quantum devices that have revolutionized telecommunications. The figure on the back cover gives the energy gap and lattice parameter for the entire compositional range of the binary, ternary, and quaternary combinations of these III-V elements. By understanding the material and learning to control the growth new devices become possible: the front cover shows the worlds first InP/GaInAs superlattice that was fabricated by the author ? this has gone on to be the basis of modern quantum devices like quantum cascade lasers and quantum dot infrared photodetectors.</P> <P></P> <P>Now in its second edition, this updated and combined volume contains the secrets of MOCVD growth, material optimization, and modern device technology. It begins with an introduction to semiconductor compounds and the MOCVD growth process. It then discusses<EM> in situ</EM> and <EM>ex situ</EM> characterization for MOCVD growth. Next, the book examines in detail the specifics of the growth of GaInP(As)-GaAs and GaInAs(P)-InP material systems. It examines MOCVD growth of various III-V heterojunctions and superlattices and discusses electronic and optoelectronic devices realized with this material. Spanning 30 years of research, the book is the definitive resource on MOCVD. </P>','https://vault.valueventures.co.za/assets/asset_images/9a7426a0-0a5e-41af-b1bb-6890194fd119photo.jpg','safe','2022-01-03 11:41:16','2022-01-03 11:41:16',41,153),(336,'Home Appliance Play Set','249','Baby Activity','Unbranded',NULL,'Time2Play Home Appliance Play Set','https://vault.valueventures.co.za/assets/asset_images/7237ba55-dc0f-470b-b5ce-c4b89ad59ee0photo.jpg','safe','2022-01-03 11:41:27','2022-01-03 11:41:27',41,153),(337,'Kids Metal Jewellery Engraving Design Studio','499','Fancy Dress & Costumes','Unbranded',NULL,'Individual designs can be engraved into the metal tags, which can then be beautifully designed with the jewels.\n<br/>\n<br/>Children can design 6 unique pieces of jewellery themselves.\n<br/>\n<br/>Metal tags can be engraved on both sides.\n<br/>\n<br/>Designing jewellery promotes creativity, hand-eye coordination, patience, fine motor skills and concentration in children.\n<br/>\n<br/>Specifications:\n<br/>-Suitable for children from 8 years\n<br/>-2 x 1.5V AA batteries are required (not included)\n<br/>-Dimensions: Approximately 31 x 31 x 7cm\n<br/>-Weight: 668g\n<br/>-Warning notices: Not suitable for children under 36 months. Small pieces. Choking hazard\n<br/>\n<br/>What&#39;s in the box\n<br/>1 x LENA Metal Jewelry Engarving Kit\n<br/>6 x metal pendants\n<br/>6 x chains\n<br/>1 x high-quality engraving device (suitable for soft metals, wood and plastic)\n<br/>1 x 800 colourful rhinestone beads for decorating\n<br/>1 x Glue\n