and guide for researchers in materials science, applied physics and electrical engineering. DLC: Vapor-plating. <br />','https://vault.valueventures.co.za/assets/asset_images/09e29ab6-ad7d-491b-944e-66dfa3aced5cphoto.jpg','safe','2022-01-07 08:41:02','2022-01-07 08:41:02',37,168),(404,'The Mocvd Challenge: A Survey Of Gainasp-inp And Gainasp-gaas For Photonic And Electronic Device Applications Second Edition','1771','Books','Unbranded',NULL,'<P>Written by one of the driving forces in the field, <STRONG>The MOCVD Challenge</STRONG> is a comprehensive review covering GaInAsPInP, GaInAsPGaAs, and related material for electronic and photonic device applications. These III-V semiconductor compounds have been used to realize the electronic, optoelectronic, and quantum devices that have revolutionized telecommunications. The figure on the back cover gives the energy gap and lattice parameter for the entire compositional range of the binary, ternary, and quaternary combinations of these III-V elements. By understanding the material and learning to control the growth new devices become possible: the front cover shows the worlds first InP/GaInAs superlattice that was fabricated by the author ? this has gone on to be the basis of modern quantum devices like quantum cascade lasers and quantum dot infrared photodetectors.</P> <P></P> <P>Now in its second edition, this updated and combined volume contains the secrets of MOCVD growth, material optimization, and modern device technology. It begins with an introduction to semiconductor compounds and the MOCVD growth process. It then discusses<EM> in situ</EM> and <EM>ex situ</EM> characterization for MOCVD growth. Next, the book examines in detail the specifics of the growth of GaInP(As)-GaAs and GaInAs(P)-InP material systems. It examines MOCVD growth of various III-V heterojunctions and superlattices and discusses electronic and optoelectronic devices realized with this material. Spanning 30 years of research, the book is the definitive resource on MOCVD. </P>','https://vault.valueventures.co.za/assets/asset_images/9013dc31-d139-461f-99e8-af542924ba10photo.jpg','safe','2022-01-07 08:41:09','2022-01-07 08:41:09',37,168),(405,'Lenovo Thinkpad T460 - Intel I5 + SSD 8GB RAM 14\" Laptop','7799','Laptops & Notebooks','Unbranded',NULL,'<p>Sleek and light but all business, the ThinkPad T460 is a new standard for highly mobile notebooks. Its thinner and lighter at just 21mm thin and weighing lesser than 1.7 kg with added features for robust business productivity and equipped with Intel 6th Gen Core processors and 14 HD Screen.<br><br>Intel vPro Technology makes enterprise-level manageability even more convenient and efficient. And with Windows 10 Pro you can empower yourself and your business to do great things across many devices securely anywhere, with anyone, and at any time. Fitting a variety of budgets, it\'s also very easy to use. So you can get more done right from the start.<br></p>\n<p><strong>Grade A Microsoft Certified Refurbished with 12-month warranty</strong></p>\n<p>Intel Core i5-6200U 6th Gen - 2.3Ghz (3M Cache up to 2.80 GHz)<br data-mce-fragment=1>Dual-Core With Hyper-Threading (2 core/ 4 Threads)<br data-mce-fragment=1>Intel Turbo Boost Technology 2.0<br data-mce-fragment=1>8GB DDR3 memory<br data-mce-fragment=1>240GB SSD - Solid State Drive<br data-mce-fragment=1>Intel HD 520 Graphics<br data-mce-fragment=1>HD 720p webcam<br data-mce-fragment=1>14 LED display, 200 nits Anti-glare (16:9) <br data-mce-fragment=1>Spill-resistant Keyboard with Multimedia Fn Key<br data-mce-fragment=1>MIL-STD-810G Military Certification<br data-mce-fragment=1>Glass Fibre Reinforced Plastic<br data-mce-fragment=1>No Optical Drive<br data-mce-fragment=1>4-in-1 Card Reader<br data-mce-fragment=1>3 x USB 3.0 Ports<br data-mce-fragment=1>1 x Mini-Display Port<br data-mce-fragment=1>1 x HDMI Port<br data-mce-fragment=1>UltraNav Trackpoint<br data-mce-fragment=1>Gigabit Ethernet LAN Port<br data-mce-fragment=